import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'app1';
}
<a routerLink="/allusers">User List</a>
<br>
<a routerLink="/adduser">Add User</a>
<br>
<a routerLink="/searchuser">Search User</a>
<br>
<a routerLink="/updateuser">Update User</a>
<br>
<a routerLink="/deleteuser">Delete User</a>
<router-outlet></router-outlet>
